import React from 'react';
import classes from './Movies.module.css';

const Movies = ({movies}) => {
  return (
    <div>
      <div className={classes.moviesImage}>
        {' '}
        <img
          src={`./${movies.backdrop_path}`}
          alt={movies.original_title}
        />{' '}
      </div>
      <div className={classes.moviesTitle}>
        <h3> {movies.original_title}</h3>
      </div>
      <div className={classes.moviesOverview}>Overview: {movies.overview}</div>
      <div className={classes.moviesOtherInfo}>
        Popularity: {movies.popularity} | Release Date: {movies.release_date}
      </div>
      <div className={classes.moviesVotes}>
        {' '}
        Rating: {movies.vote_average} | Vote Count: {movies.vote_count}
      </div>
    </div>
  );
};

export default Movies;
